import React from 'react';
import 'display.css';

class Display extends React.Component {
	constructor(props){
		super(props)
	}

	render() {

		return(
			<div className = 'w--100'>
				<div className = 'w--60 shadow-5 tc'>
					<h1>Hello</h1>
				</div>
			</div>

		);
	}
}

export default Display;
